INSERT INTO `lng_data` VALUES ('pwassist','pwassist_enter_email','en','Please enter an e-mail address and submit the form.\\nILIAS will send an e-mail to that address. The e-mail contains all usernames which have registered this e-mail address.\\nChoose a suitable username and use the password service to retrieve a new password. If you do not retrieve any e-mail by this service please contact your course admin or %1$s.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_enter_username_and_email','en','Enter a user name and the associated e-mail address in the fields shown below.\\nILIAS will send a message to that e-mail address. The message contains an address for a web page, where you can enter a new password for the user account.\\nIn case your unable to assign a password to your user account using this form, contact your course administration or send an e-mail to %1$s.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_enter_username_and_new_password','en','Enter the user name and the new password in the fields below.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_invalid_email','en','Please correct your e-mail address.\\nThe given e-mail address could not be found in the database.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_invalid_username_or_email','en','Please correct the text in the entry fields.\\nThe user name and e-mail address you have entered do not match an entry in the database.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_invalid_auth_mode','en','The user won\'t be authenticated directly at ILIAS. Thus, sending a password is impossible.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_login_not_match','en','Please enter another user name.\\nThe user name you have entered does not match the user name for which you had asked for password assistance.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_mail_body','en','Register a new password for your user account:\\n\\t%1$s\\n\\nThis message has been generated automatically by the ILIAS server\\n\\t%2$s\\n\\nYou (or someone at %3$s) has asked for password assistance for the user account \"%4$s\".\\n\\nPlease check carefully the conditions listed below, and proceed accordingly:\\n\\n- If you have used the password assistance form on the ILIAS server by accident:\\nDelete this mail.\\n\\n- If you are certain, that you never asked for password assistance at this ILIAS server:\\nPlease contact %5$s.\\n\\n- If you asked for password assistance, please proceed as follows:\\n\\n1. Open your browser.\\n\\n2. Enter the following address in your browser:\\n\\t%6$s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your email program has inserted these line breaks.\\n\\n3. On the web page shown by your browser, enter a new password for your user account.\\n\\nPlease note, that for security reasons, you can perform you can perform the three steps abeove only exactly once and for a limited time only. Afterwards the address becomes invalid, and you have to use the password assistance page on the ILIAS server again.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_mail_sent','en','A message has been sent to %1$s.\\nPlease check your e-mail box.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_mail_subject','en','ILIAS Password Assistance');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_not_permitted','en','Please enter another user name.\\nPassword assistance is not permitted for the user name you have entered.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_password_assigned','en','The password has been successfully assigned to user \"%1$s\".');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_session_expired','en','Please fill in this form again.\\nYour password assistance session has expired. This may have happened, because you tried to use the link that has been sent by e-mail to you more than once, or because too much time has passed since the link has been sent to you.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_update_error','en','Please contact your system administrator.\\nThe password could not be assigned to the user account due to an error whe updating the data base.');
INSERT INTO `lng_data` VALUES ('pwassist','pwassist_username_mail_body','en','These are the active username found for the given e-mail address:\\n%s\\n\\nThis message has been created automatically by the following ILIAS Server:\\n\\t%s\\n\\nYou (or somebody with IP  %s) have requested support for forgotten usernames for the e-mail address \'%s\'.\\n\\nPlease check the following and act as suggested::\\n\\n-You have requested this e-mail by accident:\\nDelete this e-mail.\\n\\n-You are sure, that you never requested this e-mail:\\nPlease contact %s.\\n\\n- If you requested this e-mail, please proceed as follows::\\n\\n1. Start your internet browser.\\n\\n2. Enter the following url:\\n\\t%s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your e-mail program has inserted these line breaks.\\n\\n3. Your Browser now shows the Password-Service. Use this page together with one of the usernames and the according e-mail address to retrieve a new password.');
