e_points_done\";s:55:\"The Points of an answer have been changed successfully!\";s:26:\"tst_change_points_not_done\";s:93:\"Could not change the Points of an answer! Please check the allowed range of available points.\";s:30:\"tst_change_points_for_question\";s:32:\"Change the Points for the Answer\";s:26:\"tst_confirm_delete_results\";s:287:\"You are about to delete all your previous entered question results of this test. This will reset all questions to its default values. Please note, that you cannot reset the number of passes, you already needed for this test. Do you really want to reset all your previous entered results?\";s:31:\"tst_confirm_delete_results_info\";s:90:\"Your previous entered question results were deleted. You have successfully reset the test!\";s:17:\"tst_confirm_print\";s:111:\"Press button to print all questions with points and solution. The question always appears at the end of a page.\";s:26:\"tst_confirm_submit_answers\";s:123:\"Please confirm your submission of your solution. You won\'t be able to revert your answers after pressing the submit button.\";s:27:\"tst_count_correct_solutions\";s:29:\"Count Only Complete Solutions\";s:28:\"tst_count_system_description\";s:270:\"If partial solutions are counted, the points for a question are given dependent on the answers of a participant. If only complete solutions are counted, a participant must reach the maximum available points for a question, otherwise the resulting points are set to zero.\";s:27:\"tst_count_partial_solutions\";s:23:\"Count Partial Solutions\";s:20:\"tst_defaults_applied\";s:45:\"The selected test defaults have been applied.\";s:31:\"tst_defaults_apply_not_possible\";s:134:\"ILIAS could not apply the selected test defaults to this test! Maybe this test already contains questions and/or participant datasets.\";s:29:\"tst_defaults_apply_select_one\";s:79:\"Please select exact one test defaults entry to apply the defaults to this test!\";s:22:\"tst_defaults_available\";s:23:\"Available test defaults\";s:29:\"tst_defaults_defaults_of_test\";s:28:\"the defaults of this test as\";s:21:\"tst_defaults_dont_use\";s:35:\"--- Use the ILIAS test defaults ---\";s:23:\"tst_defaults_enter_name\";s:43:\"Please enter a name for your test defaults!\";s:24:\"tst_defaults_not_defined\";s:45:\"You don\'t have any test defaults defined yet.\";s:24:\"tst_delete_all_user_data\";s:20:\"Delete all User Data\";s:23:\"tst_delete_missing_mark\";s:49:\"Please select at least one mark step to delete it\";s:18:\"tst_delete_results\";s:10:\"Reset Test\";s:15:\"tst_ending_time\";s:11:\"Ending Time\";s:22:\"tst_enter_questionpool\";s:71:\"Please enter a question pool name where the new question will be stored\";s:33:\"tst_eval_no_anonymous_aggregation\";s:90:\"No one has entered the test yet. There are no anonymous aggregated test results available.\";s:24:\"tst_eval_question_points\";s:28:\"Question Results for Pass %s\";s:24:\"tst_eval_results_by_pass\";s:27:\"List of Answers for Pass %s\";s:20:\"tst_eval_show_answer\";s:11:\"Show Answer\";s:23:\"tst_eval_total_finished\";s:79:\"Total Finished Tests (users who submitted the test with the finish test button)\";s:36:\"tst_eval_total_finished_average_time\";s:28:\"Average Test Processing Time\";s:21:\"tst_eval_total_passed\";s:18:\"Total Passed Tests\";s:36:\"tst_eval_total_passed_average_points\";s:30:\"Average Points of Passed Tests\";s:34:\"tst_eval_total_passed_average_time\";s:43:\"Average Processing Time of all Passed Tests\";s:22:\"tst_eval_total_persons\";s:44:\"Total number of persons who started the test\";s:20:\"tst_eval_user_answer\";s:11:\"User Answer\";s:25:\"tst_finish_confirm_button\";s:30:\"Yes, I want to finish the test\";s:32:\"tst_finish_confirm_cancel_button\";s:36:\"No, go back to the previous question\";s:41:\"tst_finish_confirm_list_of_answers_button\";s:34:\"No, go back to the List of Answers\";s:32:\"tst_finish_confirmation_question\";s:192:\"You are going to finish this test and reach the maximum number of allowed test passes. You won\'t be able to enter this test again to change your answers. Do you really want to finish the test?\";s:12:\"tst_finished\";s:8:\"Finished\";s:34:\"tst_fixed_participants_data_exists\";s:109:\"There are already participants who ran the test. You are not allowed to change the fixed participants status!\";s:30:\"tst_fixed_participants_disable\";s:21:\"Confirm Status Change\";s:42:\"tst_fixed_participants_disable_description\";s:250:\"You are about to disable the support for fixed participants in this test. There are already fixed participants in this test. If you remove these participants, the test results of the participants will not be deleted. Are you sure you want to proceed?\";s:22:\"tst_general_properties\";s:18:\"General Properties\";s:16:\"tst_generate_xls\";s:14:\"Generate Excel\";s:19:\"tst_heading_scoring\";s:7:\"Scoring\";s:25:\"tst_hide_previous_results\";s:21:\"Hide Previous Results\";s:37:\"tst_hide_previous_results_description\";s:102:\"If checked, the previous results of a learner will not be used as default values in future test passes\";s:30:\"tst_hide_previous_results_hide\";s:41:\"Hide my results from a previous test pass\";s:38:\"tst_hide_previous_results_introduction\";s:118:\"If you\'re processing more than one pass of this test, your previous entered results will not be used as default values\";s:19:\"tst_import_no_items\";s:45:\"Error: The import file contains no questions!\";s:33:\"tst_import_verify_found_questions\";s:123:\"ILIAS found the following questions in the test import file. Please select the questions you want to import with this test.\";s:34:\"tst_in_use_edit_questions_disabled\";s:97:\"The test is in use by %d user(s). You are not allowed to edit or move the questions in this test!\";s:27:\"tst_insert_missing_question\";s:63:\"Please select at least one question to insert it into the test!\";s:20:\"tst_insert_questions\";s:70:\"Are you sure you want to insert the following question(s) to the test?\";s:32:\"tst_insert_questions_and_results\";s:194:\"This test was already executed by %s user(s). Inserting questions to this test will remove all test results of these users. Are you sure you want to insert the following question(s) to the test?\";s:20:\"tst_instant_feedback\";s:16:\"Instant Feedback\";s:36:\"tst_instant_feedback_answer_specific\";s:29:\"Show Answer-Specific Feedback\";s:28:\"tst_instant_feedback_results\";s:26:\"Show Results (only points)\";s:29:\"tst_instant_feedback_solution\";s:14:\"Show Solutions\";s:32:\"tst_instant_feedback_description\";s:394:\"If one of the options is selected, the instant feedback information will be shown directly after a participant answered a question. If answer-specific feedback is selected, the predefined feedback will be shown, depending on the answers of the participant. If results (in points) are selected, the reached points will be shown. If solutions are selected, the correct solution will be shown too.\";s:24:\"tst_instant_verification\";s:20:\"Instant Verification\";s:16:\"tst_introduction\";s:12:\"Introduction\";s:26:\"tst_invited_selected_users\";s:61:\"The selected users have been added as fixed test participants\";s:27:\"tst_invited_selected_groups\";s:62:\"The selected groups have been added as fixed test participants\";s:26:\"tst_invited_selected_roles\";s:61:\"The selected roles have been added as fixed test participants\";s:18:\"tst_invited_nobody\";s:68:\"No users, groups or roles have been added as fixed test participants\";s:19:\"tst_list_of_answers\";s:15:\"List of Answers\";s:25:\"tst_list_of_questions_yes\";s:19:\"Yes, and additional\";s:27:\"tst_list_of_questions_start\";s:54:\"Show the List of Questions prior to the first question\";s:25:\"tst_list_of_questions_end\";s:65:\"Show the List of Questions before a participant finishes the test\";s:19:\"tst_participants_no\";s:38:\"Nobody has started the test right now!\";s:25:\"tst_participants_no_fixed\";s:62:\"There is nobody assigned as a fixed participant for this test!\";s:8:\"tst_mark\";s:4:\"Mark\";s:29:\"tst_mark_create_new_mark_step\";s:20:\"Create New Mark Step\";s:34:\"tst_mark_create_simple_mark_schema\";s:25:\"Create Simple Mark Schema\";s:22:\"tst_mark_minimum_level\";s:20:\"Minimum Level (in %)\";s:22:\"tst_mark_official_form\";s:13:\"Official Form\";s:15:\"tst_mark_passed\";s:6:\"Passed\";s:19:\"tst_mark_short_form\";s:10:\"Short Form\";s:21:\"tst_max_allowed_users\";s:24:\"Participants Restriction\";s:29:\"tst_max_allowed_users_heading\";s:70:\"The maximum number of simultaneous users in this test has been reached\";s:29:\"tst_max_allowed_users_message\";s:264:\"The maximum number of simultaneous active users in the test has been reached. Please try again later to start or resume the test. If one of the active users is inactive for more than %s seconds, you may be able to enter this test. Thank you for your understanding.\";s:18:\"tst_maximum_points\";s:14:\"Maximum Points\";s:18:\"tst_missing_author\";s:89:\"You have not entered the authors name in the test properties! Please add an authors name.\";s:17:\"tst_missing_marks\";s:96:\"You do not have a mark schema in the test! Please add at least a simple mark schema to the test.\";s:21:\"tst_missing_questions\";s:90:\"You do not have any questions in the test! Please add at least one question into the test.\";s:17:\"tst_missing_title\";s:87:\"You have not entered a test title! Please go to the metadata section and enter a title.\";s:23:\"tst_must_be_online_exam\";s:47:\"This option is only available for online exams!\";s:22:\"tst_no_evaluation_data\";s:77:\"No one has started the test right now. There is no evaluation data available.\";s:20:\"tst_no_marks_defined\";s:72:\"There are no marks defined, please create at least a simple mark schema!\";s:35:\"tst_no_more_available_questionpools\";s:42:\"There are no more question pools available\";s:36:\"tst_no_question_selected_for_removal\";s:48:\"Please check at least one question to remove it!\";s:36:\"tst_no_questionpools_for_random_test\";s:98:\"You have not added a question pool for this random test! Please select at least one question pool.\";s:26:\"tst_no_questions_available\";s:91:\"There are no questions available! You need to create new questions or browse for questions.\";s:32:\"tst_no_questions_for_random_test\";s:170:\"You have taken no questions from the questionspools for this random test! Please take at least one question by setting the amount of questions for an added question pool.\";s:25:\"tst_no_solution_available\";s:55:\"Short answer questions don\'t have a specified solution.\";s:18:\"tst_no_taken_tests\";s:25:\"There are no taken tests!\";s:12:\"tst_no_tries\";s:4:\"none\";s:16:\"tst_nr_of_passes\";s:21:\"Number of Test Passes\";s:15:\"tst_nr_of_tries\";s:21:\"Max. Number of Passes\";s:23:\"tst_nr_of_tries_of_user\";s:24:\"Passes Already Completed\";s:23:\"tst_participating_users\";s:19:\"Participating Users\";s:29:\"tst_fixed_participating_users\";s:31:\"Fixed Participants in this Test\";s:18:\"tst_pass_best_pass\";s:19:\"Score the Best Pass\";s:16:\"tst_pass_details\";s:12:\"Pass Details\";s:18:\"tst_pass_last_pass\";s:19:\"Score the Last Pass\";s:28:\"tst_pass_scoring_description\";s:301:\"If the last pass is scored, the last test pass of a participant will be used to calculate the test results. If the best pass is scored, the test pass with the highest number of reached points will be chosen a test result. This setting only has effect, if more than one test pass is allowed for a test.\";s:16:\"tst_pass_scoring\";s:21:\"Multiple Pass Scoring\";s:10:\"tst_passes\";s:11:\"Test Passes\";s:12:\"tst_password\";s:13:\"Test Password\";s:20:\"tst_password_details\";s:100:\"If you define a test password, all users with test access must enter this password to start the test\";s:35:\"tst_password_entered_wrong_password\";s:70:\"You cannot start the test because you entered the wrong test password!\";s:25:\"tst_password_introduction\";s:101:\"This test can only be accessed with a test password. Please enter the test password to start the test\";s:18:\"tst_percent_solved\";s:14:\"Percent Solved\";s:12:\"tst_position\";s:17:\"Question %s of %s\";s:12:\"tst_postpone\";s:18:\"Postpone Questions\";s:24:\"tst_postpone_description\";s:62:\"The participants may postpone questions to the end of the test\";s:9:\"tst_print\";s:28:\"Test & Assessment Print View\";s:14:\"tst_print_date\";s:13:\"Date of Print\";s:19:\"tst_processing_time\";s:20:\"Max. Processing Time\";s:14:\"tst_properties\";s:15:\"Test Properties\";s:13:\"tst_qst_order\";s:5:\"Order\";s:19:\"tst_qst_resetsolved\";s:12:\"Set Unsolved\";s:20:\"tst_qst_result_sheet\";s:17:\"Show Result Sheet\";s:17:\"tst_qst_setsolved\";s:10:\"Set Solved\";s:20:\"tst_qst_summary_text\";s:75:\"Here you can see all questions. Use the bulbs to mark a question as solved.\";s:15:\"tst_question_no\";s:5:\"Order\";s:18:\"tst_question_offer\";s:53:\"Do you accept this sample or do you want another one?\";s:22:\"tst_question_selection\";s:18:\"Question Selection\";s:34:\"tst_question_selection_description\";s:287:\"If you only use question pools which contain questions with an equal maximum number of available points, the test will have an equal number of maximum points for all participating users and thus the test results will be better comparable. It is recommended to choose this selection mode.\";s:28:\"tst_question_selection_equal\";s:44:\"Use question pools with equal maximum points\";s:25:\"tst_question_solved_state\";s:6:\"Solved\";s:18:\"tst_question_title\";s:5:\"Title\";s:17:\"tst_question_type\";s:13:\"Question Type\";s:22:\"tst_questions_inserted\";s:21:\"Question(s) inserted!\";s:21:\"tst_questions_removed\";s:20:\"Question(s) removed!\";s:26:\"tst_random_nr_of_questions\";s:19:\"How many questions?\";s:25:\"tst_random_qpl_unselected\";s:90:\"There is at least one unselected question pool! You don\'t need to add a new question pool.\";s:24:\"tst_random_questionpools\";s:21:\"Source Question Pools\";s:30:\"tst_random_select_questionpool\";s:53:\"Select the question pool to choose the questions from\";s:20:\"tst_random_selection\";s:29:\"Random Selection of Questions\";s:44:\"tst_random_selection_question_count_too_high\";s:140:\"The question count you entered was higher than the maximum number of available questions. The question count has been reduced automatically.\";s:50:\"tst_random_selection_question_total_count_too_high\";s:172:\"The question count you entered was higher than the maximum number of available questions for all selected question pools. The question count has been reduced automatically.\";s:15:\"tst_random_test\";s:11:\"Random Test\";s:27:\"tst_random_test_description\";s:81:\"If checked, the questions of the test will be chosen randomly from question pools\";s:18:\"tst_reached_points\";s:14:\"Reached Points\";s:20:\"tst_remove_questions\";s:72:\"Are you sure you want to remove the following question(s) from the test?\";s:32:\"tst_remove_questions_and_results\";s:197:\"This test was already executed by %s user(s). Removing questions from this test will remove all test results of these users. Are you sure you want to remove the following question(s) from the test?\";s:31:\"tst_report_after_first_question\";s:49:\"Offer test results when the test has been started\";s:25:\"tst_report_after_question\";s:37:\"Allow instant verification of answers\";s:21:\"tst_report_after_test\";s:44:\"Offer test results when the test is finished\";s:26:\"tst_result_congratulations\";s:37:\"Congratulations! You passed the test.\";s:16:\"tst_result_sorry\";s:27:\"Sorry, you failed the test.\";s:20:\"tst_result_user_name\";s:19:\"Test Results for %s\";s:25:\"tst_result_user_name_pass\";s:30:\"Results of Test Pass %s for %s\";s:11:\"tst_results\";s:12:\"Test Results\";s:18:\"tst_results_access\";s:22:\"Access to Test Results\";s:27:\"tst_results_access_finished\";s:22:\"After Test is Finished\";s:23:\"tst_results_access_date\";s:4:\"Date\";s:25:\"tst_results_access_always\";s:6:\"Always\";s:30:\"tst_results_access_description\";s:749:\"This setting handles the access of the participants to their test results. If results can be accessed after the test is finished, the participants can access their test results after they finished a test pass for the first time. Even if a test has more than one allowed test pass, the participants can access their test results after finishing the first pass. If you choose a date access restriction, the participants will not be able to access their test results until the specified date and time is reached. You must choose this option if you want to use the ECTS scoring system of if you have to score questions manually. If \"Always\" is selected, the participants can access their test results at any time even if the did not finish the test yet.\";s:22:\"tst_results_aggregated\";s:23:\"Aggregated Test Results\";s:27:\"tst_results_back_evaluation\";s:27:\"Back to Evaluation Overview\";s:29:\"tst_results_back_introduction\";s:20:\"Back to Introduction\";s:25:\"tst_results_back_overview\";s:24:\"Back to Results Overview\";s:20:\"tst_results_overview\";s:33:\"Pass Overview of the Test Results\";s:25:\"tst_results_overview_pass\";s:28:\"Results Overview for Pass %s\";s:24:\"tst_results_presentation\";s:25:\"Test Results Presentation\";s:15:\"tst_resume_test\";s:15:\"Resume the Test\";s:22:\"tst_score_cut_question\";s:32:\"Cut off Negative Question Points\";s:18:\"tst_score_cut_test\";s:28:\"Cut off Negative Test Points\";s:29:\"tst_score_cutting_description\";s:315:\"If Negative Question Points are cut off, the results for each question that a participant answers with a result of less than zero points will be set to zero points. If Negative Test Points are cut off, the results for the test will be set to zero points, if the sum of all question results is less than zero points.\";s:17:\"tst_score_cutting\";s:23:\"Cut off Negative Points\";s:24:\"tst_score_mcmr_questions\";s:25:\"Multiple Choice Questions\";s:33:\"tst_score_mcmr_use_scoring_system\";s:21:\"Use the Defined Score\";s:36:\"tst_score_mcmr_questions_description\";s:216:\"If \"Score 0 Points for Unchecked Answers\" is selected, multiple choice questions without a selected check box will scored with zero points, otherwise every check box will be scored dependent to the predefined points.\";s:42:\"tst_score_mcmr_zero_points_when_unanswered\";s:36:\"Score 0 Points for Unchecked Answers\";s:19:\"tst_score_reporting\";s:15:\"Score Reporting\";s:24:\"tst_score_reporting_date\";s:20:\"Score Reporting Date\";s:14:\"tst_score_type\";s:20:\"Score Reporting Type\";s:26:\"tst_select_file_for_import\";s:34:\"You must select a file for import!\";s:15:\"tst_select_qpls\";s:45:\"Please select a question pool for duplication\";s:23:\"tst_select_questionpool\";s:59:\"Please select a question pool to store the created question\";s:24:\"tst_select_questionpools\";s:61:\"Please select a question pool to store the imported questions\";s:27:\"tst_select_random_questions\";s:75:\"Select the question pool(s) and the amount of questions for the random test\";s:15:\"tst_select_tsts\";s:36:\"Please select a test for duplication\";s:30:\"tst_selected_user_data_deleted\";s:62:\"The test data of the selected user(s) was deleted successfully\";s:12:\"tst_sequence\";s:8:\"Sequence\";s:18:\"tst_sequence_fixed\";s:34:\"The Sequence of Questions is Fixed\";s:23:\"tst_sequence_properties\";s:19:\"Sequence Properties\";s:20:\"tst_session_settings\";s:16:\"Session Settings\";s:24:\"tst_list_of_answers_show\";s:20:\"Show List of Answers\";s:21:\"tst_show_answer_sheet\";s:12:\"Show Answers\";s:15:\"tst_show_cancel\";s:24:\"Show Suspend Test Option\";s:27:\"tst_show_cancel_description\";s:71:\"If checked, a button to suspend the test is shown during test execution\";s:16:\"tst_title_output\";s:17:\"Test Title Output\";s:21:\"tst_title_output_full\";s:36:\"Show Test Title and Available Points\";s:28:\"tst_