e shopping cart. By filling in your data for the debit entry and clicking the \"Save\"-button you confirm your wish to order, that starts immediately. The data check may take some seconds.\";s:32:\"pay_bmf_description_payment_type\";s:25:\"Please select how to pay.\";s:33:\"pay_bmf_description_personal_data\";s:46:\"Please fill out the following form completely.\";s:20:\"pay_bmf_house_number\";s:12:\"House number\";s:16:\"pay_bmf_optional\";s:8:\"optional\";s:10:\"pay_bmf_or\";s:2:\"or\";s:26:\"pay_bmf_password_not_valid\";s:27:\"Your password wasn\'t valid.\";s:20:\"pay_bmf_payment_type\";s:14:\"Kind of paying\";s:30:\"pay_bmf_payment_type_not_valid\";s:76:\"The kind of paying you\'ve choosen isn\'t valid. Please select another option.\";s:21:\"pay_bmf_personal_data\";s:18:\"Your personal data\";s:31:\"pay_bmf_personal_data_not_valid\";s:93:\"Your personal data isn\'t valid. Please check out whether all fields are filled out correctly.\";s:21:\"pay_bmf_please_select\";s:13:\"Please select\";s:14:\"pay_bmf_po_box\";s:6:\"PO Box\";s:25:\"pay_bmf_server_error_code\";s:33:\"Payment server returns error code\";s:34:\"pay_bmf_server_error_communication\";s:46:\"Error while communictaion with payment server.\";s:29:\"pay_bmf_server_error_sysadmin\";s:60:\"Please contact system administrator for further information.\";s:27:\"pay_bmf_shopping_cart_empty\";s:28:\"Your shopping card is empty.\";s:23:\"pay_bmf_street_or_pobox\";s:47:\"Please enter street and house number or po box.\";s:24:\"pay_bmf_terms_conditions\";s:28:\"General terms and conditions\";s:29:\"pay_bmf_terms_conditions_read\";s:57:\"I\'ve read the general terms and conditions and accept it.\";s:29:\"pay_bmf_terms_conditions_show\";s:4:\"show\";s:14:\"pay_bmf_thanks\";s:36:\"Thank you. Your order was submitted.\";s:20:\"pay_bmf_total_amount\";s:12:\"Total amount\";s:16:\"pay_bmf_validity\";s:11:\"valid until\";s:20:\"pay_bmf_vat_included\";s:12:\"VAT included\";s:18:\"pay_bmf_your_order\";s:10:\"Your order\";s: