der we send you a bill (PDF format) as attachment.\";s:17:\"pay_message_hello\";s:4:\"Dear\";s:19:\"pay_message_regards\";s:15:\"Yours sincerely\";s:19:\"pay_message_subject\";s:16:\"Your ILIAS order\";s:18:\"pay_message_thanks\";s:33:\"Thank you for your ILIAS 3 order.\";s:22:\"pay_no_vendors_created\";s:18:\"No vendors created\";s:24:\"pay_not_buyed_any_object\";s:31:\"You have not bought any object.\";s:19:\"pay_order_date_from\";s:15:\"Order date from\";s:18:\"pay_order_date_til\";s:14:\"Order date til\";s:21:\"pay_payed_credit_card\";s:34:\"The order was paid by credit card.\";s:21:\"pay_payed_debit_entry\";s:34:\"The order was paid by debit entry.\";s:16:\"pay_payed_paypal\";s:29:\"The order was paid by PayPal.\";s:22:\"pay_paypal_error_fails\";s:58:\"PayPal reports errors that occured during the transaction.\";s:21:\"pay_paypal_error_info\";s:86:\"If necessary feel free to contact the system administrator of this ILIAS installation.\";s:30:\"pay_paypal_error_not_completed\";s:44:\"The transaction isn\'t totally completed yet.\";s:30:\"pay_paypal_error_prev_trans_id\";s:59:\"The transaction id given by PayPal was already used before.\";s:31:\"pay_paypal_error_wrong_customer\";s:63:\"Checking this transaction resulted in no match of the customer.\";s:28:\"pay_paypal_error_wrong_items\";s:65:\"Checking this transaction resulted in no match of the sold items.\";s:29:\"pay_paypal_error_wrong_vendor\";s:61:\"Checking this transaction resulted in no match of the vendor.\";s:17:\"pay_paypal_failed\";s:50:\"Your puchase of ILIAS objects using PayPal failed!\";s:18:\"pay_paypal_success\";s:118:\"Thanks for your purchase of ILIAS objects using PayPal! You\'ll receive a written confirmation in PDF format by e-mail.\";s:22:\"pay_paypal_unreachable\";s:54:\"The connection to the payment server of PayPal failed.\";s:16:\"pay_reset_filter\";s:12:\"Reset filter\";s:19:\"pay_select_one_item\";s:23:\"Please select one item.\";s:16:\"pay_select_price\";s:43:\"Please select a pri