:\"pays_pdf_path\";s:36:\"Path for generating bill as PDF file\";s:16:\"pays_server_host\";s:33:\"Server host (e.g. www.paypal.com)\";s:16:\"pays_server_path\";s:42:\"Path to the scripts (e.g. /cgi-bin/webscr)\";s:33:\"pays_sure_delete_selected_vendors\";s:51:\"Do you really want to delete the selected vendor(s)\";s:30:\"pays_too_many_vendors_selected\";s:55:\"Please select only one customer to perform this action.\";s:29:\"pays_updated_general_settings\";s:35:\"Your general settings were updated.\";s:23:\"pays_updated_pay_method\";s:19:\"Changed pay method.\";s:28:\"pays_updated_paypal_settings\";s:38:\"Your settings for PayPal were updated.\";s:26:\"pays_user_already_assigned\";s:48:\"This user is already assigned to the vendor list\";s:13:\"pays_vat_rate\";s:24:\"VAT rate in % (optional)\";s:11:\"pays_vendor\";s:6:\"Vendor\";s:7:\"price_a\";s:5:\"Price\";s:6:\"prices\";s:6:\"Prices\";s:6:\"update\";s:6:\"Update\";}');
INSERT INTO `lng_modules` VALUES ('pwassist','en','a:16:{s:19:\"password_assistance\";s:19:\"Password Assistance\";s:20:\"pwassist_enter_email\";s:349:\"Please enter an e-mail address and submit the form.\\nILIAS will send an e-mail to that address. The e-mail contains all usernames which have registered this e-mail address.\\nChoose a suitable username and use the password service to retrieve a new password. If you do not retrieve any e-mail by this service please contact your course admin or %1$s.\";s:33:\"pwassist_enter_username_and_email\";s:376:\"Enter a user name and the associated e-mail address in the fields shown below.\\nILIAS will send a message to that e-mail address. The message contains an address for a web page, where you can enter a new password for the user account.\\nIn case your unable to assign a password to your user account using this form, contact your course administration or send an e-mail to %1$s.\";s:40:\"pwassist_enter_username_and_new_password\";s:61:\"Enter the user name and the new password in the fields below.\";s:22:\"pwassist_invalid_email\";s:97:\"Please correct your e-mail address.\\nThe given e-mail address could not be found in the database.\";s:34:\"pwassist_invalid_username_or_email\";s:134:\"Please correct the text in the entry fields.\\nThe user name and e-mail address you have entered do not match an entry in the database.\";s:26:\"pwassist_invalid_auth_mode\";s:90:\"The user won\'t be authenticated directly at ILIAS. Thus, sending a password is impossible.\";s:24:\"pwassist_login_not_match\";s:141:\"Please enter another user name.\\nThe user name you have entered does not match the user name for which you had asked for password assistance.\";s:18:\"pwassist_mail_body\";s:1174:\"Register a new password for your user account:\\n\\t%1$s\\n\\nThis message has been generated automatically by the ILIAS server\\n\\t%2$s\\n\\nYou (or someone at %3$s) has asked for password assistance for the user account \"%4$s\".\\n\\nPlease check carefully the conditions listed below, and proceed accordingly:\\n\\n- If you have used the password assistance form on the ILIAS server by accident:\\nDelete this mail.\\n\\n- If you are certain, that you never asked for password assistance at this ILIAS server:\\nPlease contact %5$s.\\n\\n- If you asked for password assistance, please proceed as follows:\\n\\n1. Open your browser.\\n\\n2. Enter the following address in your browser:\\n\\t%6$s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your email program has inserted these line breaks.\\n\\n3. On the web page shown by your browser, enter a new password for your user account.\\n\\nPlease note, that for security reasons, you can perform you can perform the three steps abeove only exactly once and for a limited time only. Afterwards the address becomes invalid, and you have to use the password assistance page on the ILIAS server again.\";s:18:\"pwassist_mail_sent\";s:63:\"A message has been sent to %1$s.\\nPlease check your e-mail box.\";s:21:\"pwassist_mail_subject\";s:25:\"ILIAS Password Assistance\";s:22:\"pwassist_not_permitted\";s:105:\"Please enter another user name.\\nPassword assistance is not permitted for the user name you have entered.\";s:26:\"pwassist_password_assigned\";s:59:\"The password has been successfully assigned to user \"%1$s\".\";s:24:\"pwassist_session_expired\";s:261:\"Please fill in this form again.\\nYour password assistance session has expired. This may have happened, because you tried to use the link that has been sent by e-mail to you more than once, or because too much time has passed since the link has been sent to you.\";s:21:\"pwassist_update_error\";s:141:\"Please contact your system administrator.\\nThe password could not be assigned to the user account due to an error whe updating the data base.\";s:27:\"pwassist_username_mail_body\";s:908:\"These are the active username found for the given e-mail address:\\n%s\\n\\nThis message has been created automatically by the following ILIAS Server:\\n\\t%s\\n\\nYou (or somebody with IP  %s) have requested support for forgotten usernames for the e-mail address \'%s\'.\\n\\nPlease check the following and act as suggested::\\n\\n-You have requested this e-mail by accident:\\nDelete this e-mail.\\n\\n-You are sure, that you never requested this e-mail:\\nPlease contact %s.\\n\\n- If you requested this e-mail, please proceed as follows::\\n\\n1. Start your internet browser.\\n\\n2. Enter the following url:\\n\\t%s\\n\\nImportant: The address is a single line. If you see this address split into multiple lines, then your e-mail program has inserted these line breaks.\\n\\n3. Your Browser now shows the Password-Service. Use this page together with one of the usernames and the according e-mail address to retrieve a new password.\";}');
