INSERT INTO `lng_modules` VALUES ('survey','en','a:443:{s:20:\"SurveyMatrixQuestion\";s:15:\"Matrix Question\";s:20:\"SurveyMetricQuestion\";s:15:\"Metric Question\";s:21:\"SurveyNominalQuestion\";s:16:\"Nominal Question\";s:21:\"SurveyOrdinalQuestion\";s:16:\"Ordinal Question\";s:18:\"SurveyTextQuestion\";s:5:\"Essay\";s:12:\"add_category\";s:10:\"Add Answer\";s:11:\"add_heading\";s:14:\"Add Text Block\";s:31:\"add_limits_for_standard_numbers\";s:89:\"Please enter a lower and upper limit for the standard numbers you want to add as answers.\";s:10:\"add_phrase\";s:10:\"Add Phrase\";s:23:\"add_phrase_introduction\";s:23:\"Please select a Phrase:\";s:20:\"add_standard_numbers\";s:20:\"Add Standard Numbers\";s:24:\"already_completed_survey\";s:81:\"You have already finished the survey! You are not able to enter the survey again.\";s:13:\"anonymization\";s:13:\"Anonymization\";s:32:\"anonymize_anonymous_introduction\";s:222:\"This survey anonymizes all user data. To grant you access to the survey, you must use a 5-character survey code which you can receive from the creator/maintainer of this survey<br />Please enter it in the text field below.\";s:26:\"anonymize_key_introduction\";s:332:\"This survey anonymizes all user data. To grant you access to the survey, a 5-character code was created by the system and will be sent to your ILIAS e-mail inbox when you start the survey (after answering the first question). Your survey access code is<br /><span class=\"bold\">%s</span><br />Please enter it in the text field below.\";s:22:\"anonymize_personalized\";s:19:\"Personalized Survey\";s:25:\"anonymize_registered_user\";s:24:\"Anonymized Survey Access\";s:29:\"anonymize_resume_introduction\";s:126:\"Please enter your survey access code to resume the survey. It was sent to your ILIAS e-mail inbox when you started the survey.\";s:16:\"anonymize_survey\";s:21:\"Anonymize Survey Data\";s:28:\"anonymize_survey_description\";s:231:\"Anonymization removes any personal data from the survey statistics. A survey code is a five digit code which is needed to take part in an anonymized survey. For registered ILIAS users, a survey code will be generated automatically.\";s:19:\"anonymize_with_code\";s:54:\"Anonymization with personal access using a survey code\";s:22:\"anonymize_without_code\";s:44:\"Anonymization with free access to the survey\";s:34:\"anonymous_with_personalized_survey\";s:59:\"You must be a registered user to run a personalized survey!\";s:6:\"answer\";s:6:\"Answer\";s:5:\"apply\";s:5:\"Apply\";s:15:\"arithmetic_mean\";s:15:\"Arithmetic Mean\";s:25:\"ask_insert_questionblocks\";s:78:\"Are you sure you want to insert the following question block(s) to the survey?\";s:20:\"ask_insert_questions\";s:72:\"Are you sure you want to insert the following question(s) to the survey?\";s:4:\"back\";s:7:\"<< Back\";s:6:\"before\";s:6:\"before\";s:20:\"browse_for_questions\";s:20:\"Browse for Questions\";s:13:\"cancel_survey\";s:18:\"Suspend the Survey\";s:26:\"cannot_create_survey_codes\";s:72:\"You do not possess sufficient permissions to create survey access codes!\";s:18:\"cannot_edit_survey\";s:61:\"You do not possess sufficient permissions to edit the survey!\";s:26:\"cannot_export_questionpool\";s:77:\"You do not possess sufficient permissions to export the survey question pool!\";s:20:\"cannot_export_survey\";s:63:\"You do not possess sufficient permissions to export the survey!\";s:22:\"cannot_maintain_survey\";s:65:\"You do not possess sufficient permissions to maintain the survey!\";s:21:\"cannot_manage_phrases\";s:64:\"You do not possess sufficient permissions to manage the phrases!\";s:25:\"cannot_participate_survey\";s:71:\"You do not possess sufficient permissions to participate in the survey!\";s:24:\"cannot_read_questionpool\";s:73:\"You do not possess sufficient permissions to read the question pool data!\";s:18:\"cannot_read_survey\";s:66:\"You do not possess sufficient permissions to read the survey data!\";s:22:\"cannot_save